export default function SearchButtons({ GoogleSearch, homePage }) {
  return (
    <div className="search-buttons">
      <button onClick={() => GoogleSearch(!homePage)}>Google Search</button>
      <button>I'm Feeling Lucky</button>
    </div>
  );
}
